            phone : "2123445444"
        }
    }
    render() {
        return (
            <div id="main-content" >

            <div className="card account">

                 <img src="../Images/i.jpg" alt={this.state.name} style={{width:"100%"}}/>
                 <h1>{this.state.name}</h1>
                 <p className="title">CEO Founder, Example</p>
                 <p>Harvard University</p>

            </div>

            </div>
        )
    }
}

